import React from 'react';
import './FloatingIcons.css';

const FloatingIcons = () => {
    return (
        <div className="floating-icons">
            {[...Array(7)].map((_, i) => (
                <div key={`left-${i}`} style={{ animationDuration: '2s' }} className="icon left"></div>
            ))}
            {[...Array(7)].map((_, i) => (
                <div key={`right-${i}`} style={{ animationDuration: '8s' }} className="icon right"></div>
            ))}
        </div>
    );
};

export default FloatingIcons;
